  - name: TEXT4000
    number: '6'
    value: 'During the month of September, League of Conservation Voters Action Fund
      made some independent expenditures, but could only report the estimated cost
      on the dissemination date.  This October 20th report now discloses the final
      costs for the following expenditures:    The 9/2 $18,000 and 9/2 $2,000 independent
      expenditures for Futuristic Films, reported on the 9/4 48 Hour notice, were
      estimated amounts of the total invoice.  This report discloses the final amount
      paid to Futuristic Films: $15,650.  The 9/2 $27,200 independent expenditure
      for Launch Advertising, reported on the 9/4 48 Hour notice, was an estimated
      amount of the total invoice.  In December an additional invoice was paid in
      the amount of $203.32.  This report discloses the final amount paid to Launch
      Advertising: $29,674.90.  The 9/2 $4,000 independent expenditures for Rocky
      Mountain Records, reported on the 9/4 48 Hour notice, was estimated amount of
      the total invoice.  This report discloses the final amount paid to Rocky Mountain
      Records: $2,169.10.  The 9/2 $5,000 independent expenditures for Michael Boyd
      Music, reported on the 9/4 48 Hour notice, was estimated amount of the total
      invoice.  This report discloses the final amount paid to Michael Boyd Music:
      $1,000.  The 9/2 $5,000 independent expenditures for League of Conservation
      Voters, reported on the 9/4 48 Hour notice, was estimated amount of the total
      invoice.  This report discloses the final amount paid to League of Conservation
      Voters: $1,358.    On the original October 20th filing, League of Conservation
      Voters Action Fund disclosed two $5,000 contributions from Jabez Blumenthal.  These
      contributions represented a joint spousal contribution as follows: $5,000 from
      Jabez Blumenthal and $5,000 from Julie Edsforth.  The report also disclosed
      two $5,000 contributions from Steven Rockefeller. These contributions represented
      a joint spousal contribution as follows: $5,000 from Steven Rockefeller and
      $5,000 from Barbara Rockefeller.  This amended report now reflects the correct
      breakdown in the contributions.'
